    return (
        
        <div>
            {console.log(`lessons in return: ${lessons}`)}
            <div className="card mt15 p15">
                {
                    lessons.map((lesson, index) => (
                        <div className="card mt15 p15" key={`lesson-${index}`}>
                        {`hello ${lesson}`}
                        </div>
                    ))
                } 
            </div>
        </div>
    )


}

